import React from "react";

const NavigationBar = () => {
  return (
    <div>
      <img src="" alt="logo" />
      <ul>
        <li>Features</li>
        <li>Team</li>
        <li>Download</li>
      </ul>
    </div>
  );
};

export default NavigationBar;
